'use client'
import React from 'react'
import { OpenFile, Viewer, Worker } from '@react-pdf-viewer/core'
import { getFilePlugin } from '@react-pdf-viewer/get-file'
import { zoomPlugin } from '@react-pdf-viewer/zoom'
import { printPlugin } from '@react-pdf-viewer/print' // Import the print plugin
import { defaultLayoutPlugin } from '@react-pdf-viewer/default-layout'
import '@react-pdf-viewer/core/lib/styles/index.css'
import '@react-pdf-viewer/default-layout/lib/styles/index.css'
import { Typography, Grid, Button,Card } from '@mui/material'
import { pageNavigationPlugin } from '@react-pdf-viewer/page-navigation';

const base64PdfArr = [
  {name:'file 1',file:'data:application/pdf;base64,'},
  {name:'file 2',file:'data:application/pdf;base64,'},
  {name:'file 3',file:'data:application/pdf;base64,'},
  {name:'file 4',file:'data:application/pdf;base64,'},
  {name:'file 5',file:'data:application/pdf;base64,'},
  {name:'file 6',file:'data:application/pdf;base64,'},
  
]
const CustomizeFileNameExample = ({ fileUrl, data }) => {
 
  // Initialize plugins
  const [selectedPdf, setSelectedPdf] = React.useState(null) // State to track selected PDF

  // Initialize plugins
  const getFilePluginInstance = getFilePlugin({
        fileNameGenerator: (file) => {
            const fileName = file.name.substring(file.name.lastIndexOf("/") + 1);
            return `${data?.PV1_VISIT_NUMBER}-${data?.PV1_CLINIC_NAME}`;
        },
    });
  const zoomPluginInstance = zoomPlugin()
  const printPluginInstance = printPlugin()
  const pageNavigationPluginInstance = pageNavigationPlugin();

  const { DownloadButton } = getFilePluginInstance
  const { ZoomInButton, ZoomOutButton } = zoomPluginInstance
  const { PrintButton } = printPluginInstance
  const { CurrentPageInput, GoToFirstPageButton, GoToLastPageButton, GoToNextPageButton, GoToPreviousPageButton } = pageNavigationPluginInstance;

  // Array of fake names (you can customize based on your needs)
  const pdfNames = base64PdfArr.map((_, index) => `PDF Document ${index + 1}`)

  return (
    <div>
      <Typography variant='h5'> File Scan</Typography>

      {/* Grid layout for PDF thumbnails */}
      <Grid container spacing={2}>
        {base64PdfArr.map((pdf, index) => (
          <Card key={index} style={{ padding: 10, margin: 10 }}>
            <div
              onClick={() => setSelectedPdf(pdf.file)}
              style={{
                cursor: 'pointer',
                textAlign: 'center',
                padding: 10,
                border: '1px solid #ccc',
                borderRadius: 8,
                backgroundColor: '#f5f5f5'
              }}
            >
              <img src='/images/logos/pdf-icon.png' alt={pdf.name} style={{ width: 50, marginBottom: 10 }} />
              <Typography variant='body1'>{pdf.name}</Typography>
            </div>
          </Card>
        ))}
      </Grid>

      {/* Show PDF Viewer when a PDF is selected */}
      {selectedPdf && (
        <div
          className='rpv-core__viewer'
          style={{
            border: '1px solid rgba(0, 0, 0, 0.3)',
            display: 'flex',
            flexDirection: 'column',
            marginTop: '20px',
            maxHeight: '500px', // Set the maximum height to a fixed value
             // Enable scrolling within the viewer
          }}
        >
          <Worker workerUrl='https://unpkg.com/pdfjs-dist@3.11.174/build/pdf.worker.min.js'>
            <div
              style={{
                alignItems: 'center',
                backgroundColor: '#eeeeee',
                borderBottom: '1px solid rgba(0, 0, 0, 0.1)',
                display: 'flex',
                padding: '4px'
              }}
            >
                
            
    
              <DownloadButton />
              <ZoomInButton>{props => <Button onClick={props.onClick}>Zoom In</Button>}</ZoomInButton>
              <ZoomOutButton>{props => <Button onClick={props.onClick}>Zoom Out</Button>}</ZoomOutButton>
              <PrintButton>{props => <Button onClick={props.onClick}>Print</Button>}</PrintButton>
            </div>
            <div style={{ flex: 1, overflow: 'auto' }}>
              <Viewer
                overflow='auto'
                fileUrl={selectedPdf}
                plugins={[getFilePluginInstance, zoomPluginInstance, printPluginInstance,pageNavigationPluginInstance]}
              />
            </div>
          </Worker>
        </div>
      )}
    </div>
  )
}

export default CustomizeFileNameExample
